@import '../../../assets/style/container.scss';
.block {
  padding: 30px 0;
  text-align: center;
  border-right: 1px solid #eff2f6;
  display: inline-block;
  width: 49%;
  box-sizing: border-box;

  &:last-child {
    border-right: none;
  }
}

.demonstration {
  display: block;
  color: #8492a6;
  font-size: 14px;
  margin-bottom: 20px;
}
.el-tag + .el-tag {
  margin-left: 10px;
}
.button-new-tag {
  cursor: pointer;
  vertical-align: middle;
  color: #3963bc;
  margin-left: 10px;
  font-size: 24px;
  height: 24px;
  line-height: 24px;
}
.input-new-tag {
  width: 90px;
  margin-left: 10px;
  vertical-align: bottom;
}
.input-new-tag ::v-deep .el-input__inner {
  height: 24px;
}
